import React, { Component } from "react";
import Popup from "reactjs-popup";

class Event extends Component{
  render(){
    return(
      <Popup style={{width:"auto"}} trigger={<button>Create an Event</button>} position="right top">
    <form onSubmit={events()}>
        Event name:
        <input type="text" id="name" required/>
        Event Desc:
        <input type="text" required/>
        From
        <input type="date"/>
        <input type="time"/>
        To
        <input type="date"/>
        <input type="time"/>
        <input type="submit"/>

    </form>
  </Popup>
    )
  }
}

export default Event;
